import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.png';

function Home(){
  return (
    <section id="intro">
      <div className="rectbox">
        <div className="imgcontainer">
        <img src={imgme} alt="Me" className="photoofme" />
        <span className="name"></span>
      </div>
      </div>
      
    </section>
  );
}

export default Home;
